import React, { Component } from 'react';
import './App.css';
import Navigation from "./components/Navigation/Navigation.jsx";
import Logo from "./components/Logo/Logo.jsx";
import ImageLinkForm from "./components/ImageLinkForm/ImageLinkForm.jsx";
import Rank from "./components/Ranks/Rank.jsx";
import Particles from 'react-particles-js';
import Clarifai from 'clarifai';
import FaceRecognize from "./components/FaceRecognize/FaceRecognize.jsx";

const app = new Clarifai.App({
    apiKey: '8051425abdb743aaa341e9c9c0374175'
});

const particlesOptions = {
    particles: {
        number: {
            value: 100,
            density: {
                enable: true,
                value_area: 800
            }
        }
    }
};

class App extends Component {
    constructor() {
        super();
        this.state = {
            input: '',
            imgUrl: ''
        }
    }
    onInputChange = (e) => {
        console.log(this.state.input);
        this.setState({
            input: e.target.value
        })
    };
    onSubmit = () => {
        this.setState({
            imgUrl: this.state.input
        });
        console.log("click");
        app.models
            .predict(Clarifai.COLOR_MODEL,`https://samples.clarifai.com/face-det.jpg`)
            .then(
            function(response) {
                console.log(response);
            },
            function(err) {
                // there was an error
            }
        );
    };

    render() {
    return (
      <div className="App">
          <Particles className="particles" params={particlesOptions}/>
          <Navigation/>
          <Logo/>
          <Rank/>
          <ImageLinkForm onInputChange={this.onInputChange} onSubmit={this.onSubmit}/>
          <FaceRecognize image={this.state.input}/>
      </div>
    );
  }
}

export default App;
